import React from "react";


const Contact = () => {
    return (
        <div className="container">
            <div className="py-4">
                <h1>Get In Touch</h1>

                <div className="row mt-4">
                    <div className="col-6">
                    <p><h5>Address For Noida Office : </h5>101, Infinity Business Park, Plot H-221, Sector 63, Noida, Uttar Pradesh 201307 </p>

                    </div>
                </div>



            </div>
        </div>
    );
};



export default Contact;
